import React from "react";
import { EXAMPLE_MSG, EXAMPLE_OBJ } from "./types";

export const exampleMessage = () => (dispatch) => {
  dispatch({
    type: EXAMPLE_MSG,
    payload: "WORKED!",
  });
};

export const exampleObject = () => (dispatch) => {
  dispatch({
    type: EXAMPLE_OBJ,
    payload: {
      friends: [0, 1, 2, 3, 4],
    },
  });
};
